syntax = "proto3";

option java_package = "emu.grasscutter.net.proto";

import "ProfilePicture.proto";

// Name: JIPFDPOBPNH
message JIPFDPOBPNH {
    ProfilePicture profile_picture = 11;
    map<uint32, uint32> DKJCBIKONDH = 3;
    uint32 uid = 8;
    uint32 controller_id = 1;
    string nick_name = 9;
    string online_id = 7;
    repeated uint32 ECNNODOGJIA = 2;
    string psn_id = 14;
}

